//importando o componente PostCart
import {PostCard} from '../PostCard'

export const Posts = ({posts})=>{
  return(
    <div className="App, posts">     
          {posts.map(post=> (
            <PostCard 
                      key={post.id}
                      post={post}
            />  
          ))}
    </div>
  )  
}
